import React, { Fragment, Component } from 'react';
import SearchBox from './SearchBox';
import CardList from './CardList';

class App extends Component {
	constructor() {
		super();
		this.state = {
			robots: robots,
			searchField: ''
		};
	}

	render() {
		return (
			<Fragment>
				<div className="tc">
					<h1>Robo Friends</h1>
					<SearchBox />
					<CardList robots={this.state.robots} />
				</div>
			</Fragment>
		);
	}
}

export default App;
